/*
cmsexcel2sql file=\cvs\csr\db2\egrid.xlsx out=\temp\eg.sql ws=5 map=\temp\map.xml tablename=EGRID /noenums
sqlplus upd/upd@aspen @\temp\eg.sql rt.credit360.com rt
cmsexcelimp table=EGRID file=\cvs\csr\db2\egrid.xlsx ws=5 map=\temp\map.xml out=\temp\err.xls host=rt.credit360.com

			
spool \temp\data.sql
DECLARE	
	v_cnt NUMBER(10);
BEGIN
	dbms_output.enable(NULL);
	DBMS_OUTPUT.PUT_LINE('ALTER TABLE CSR.POSTCODE_EGRID DISABLE CONSTRAINT FK_POSTCODE_POSTCODE_EGRID;');
	DBMS_OUTPUT.PUT_LINE('TRUNCATE TABLE CSR.POSTCODE_EGRID;');
	FOR r iN (
		SELECT DISTINCT PRIMARY_EGRID_SUBREGION from rt.egrid ORDER BY PRIMARY_EGRID_SUBREGION
	)
	LOOP
		DBMS_OUTPUT.PUT_LINE('-- '||r.PRIMARY_EGRID_SUBREGION);
		DBMS_OUTPUT.PUT_LINE('BEGIN');
		DBMS_OUTPUT.PUT_LINE('DBMS_OUTPUT.PUT_LINE(''Inserting '||r.PRIMARY_EGRID_SUBREGION||'...'');');
		v_cnt := 1;
		FOR j IN (
			SELECT ZIP_CHARACTER, PRIMARY_EGRID_SUBREGION from rt.egrid where PRIMARY_EGRID_SUBREGION = r.PRIMARY_EGRID_SUBREGION
		)
		LOOP
			IF MOD(v_cnt, 4000) = 0 THEN
				DBMS_OUTPUT.PUT_LINE('END;');
				DBMS_OUTPUT.PUT_LINE('/');
				DBMS_OUTPUT.PUT_LINE('BEGIN');
			END IF;
			DBMS_OUTPUT.PUT_LINE('INSERT INTO CSR.POSTCODE_EGRID (COUNTRY, POSTCODE, EGRID_REF) VALUES (''us'', '''||LPAD(j.ZIP_CHARACTER,5,'0')||''','''||j.PRIMARY_EGRID_SUBREGION||''');');
			v_cnt := v_cnt + 1;
		END LOOP;
		DBMS_OUTPUT.PUT_LINE('END;');
		DBMS_OUTPUT.PUT_LINE('/');
	END LOOP;	
	DBMS_OUTPUT.PUT_LINE('-- zip codes not in our zip code list');
	DBMS_OUTPUT.PUT_LINE('INSERT INTO postcode.postcode (country, postcode)');
	DBMS_OUTPUT.PUT_LINE('    SELECT country, postcode FROM csr.postcode_egrid MINUS SELECT country, postcode FROM postcode.postcode;');
	DBMS_OUTPUT.PUT_LINE('ALTER TABLE CSR.POSTCODE_EGRID ENABLE CONSTRAINT FK_POSTCODE_POSTCODE_EGRID;');
END;
/

spool off
*/

ALTER TABLE CSR.POSTCODE_EGRID DISABLE CONSTRAINT FK_POSTCODE_POSTCODE_EGRID;
TRUNCATE TABLE CSR.POSTCODE_EGRID;
